import pandas as pd
import base64
import io

# No es un payload o algo por el estilo, es para no tener que descargar el dataset mediante una petici√≥n y a la vez no tener que subirlo como un archivo adjunto si vamos a usar un Colab.

data = ""

def get_data():
    """
    Recupera y decodifica los datos, luego los devuelve como un DataFrame de pandas.

    Returns:
        pandas.DataFrame: Los datos decodificados como un DataFrame.
    """
    decoded_data = base64.b64decode(data).decode('utf-8')
    return pd.read_csv(io.StringIO(decoded_data))


